import getEmail from "../../redux/reducers/getEmail"

const GetEmail =()=>{

    const GetJSON = ()=>{
        fetch("http://192.168.1.247:3001/api/user/home")
        .then(response=>response.json())
        .then(response=>{
            return response
        })

    }   

    console.log(getJSON())

    return(
        <h1>{GetJSON}</h1>
    )
}

export default GetEmail
